enying entry. Landlord may also enter the premises without prior consent if it appears to have been abandoned by the Tenant or in case of emergency, and as otherwise permitted by law or court order.\n\n    The Landlord agrees to maintain the premises in a structurally sound condition and to otherwise comply with an Owner\'s obligations under Article II of the Massachusetts State Sanitary Code. Substantial violations of the State Sanitary Code shall constitute grounds for abatement of rent.\n\n    Your Bills\n    Electricity\n    Gas\n    Heat*\n    Garbage Collection\n    Trash Removal\n    Hot Water', '2020-01-20 14:36:24', '2020-12-20 14:36:24', '2020-01-20 00:00:00', '2020-12-20 14:36:24', '19501.00', '19540.00', '12350.00', '19123.00', '12123.00', 'sb-ig243z728210@business.example.com', '2019-11-12 17:55:45', '2019-11-12 17:55:45');

